import React from 'react';
import Card from './Card';

function CardList({ pets, images }) {

	const items = [];

	images.map((img, j) => {
		if (images[j].defaultPic) {
			console.log(images[j].url);
		}
	});


	return (
		<div>
			{items}
		</div>
	);
}

export default CardList;

